import React from "react";
import styled from "styled-components";
import getHour from "../customFunctions/getHour";
const Test = styled.tr`
    list-style: none;
    padding: 2px;
`;
const listItem = ({ type, places, date }) => {
    return (
        <Test>
            <th> </th>
            <th></th>
            <th></th>
            <td>{type}</td>
            <td>{getHour(date)}</td>
            <td>{places}</td>
        </Test>
    );
};

export default listItem;
